function App() {
  return (
    <div className="app">
      <header>
        <img src="https://img2.freepng.ru/20171220/arw/twitter-logo-png-5a3a185138f284.88858568151375675323333199.jpg" alt="" />
      </header>
      <nav>
        <ul>
          <li><a href="#">Profile</a></li>
          <li><a href="#">Messages</a></li>
          <li><a href="#">News</a></li>
          <li><a href="#">Music</a></li>
          <li><a href="#">Settings</a></li>
        </ul>
      </nav>
      <main>
        content
      </main>
    </div>
  );
}

export default App;
